import React, { StatelessComponent } from 'react';
import { Container, Row, Col, Form } from 'react-bootstrap'

const Main: React.StatelessComponent = () => {
    return(

        <Container fluid>
          <Row>
            <Col sm={2}>
                <Sidebar></Sidebar>
            </Col>
            <Col sm={10}>
                <Content></Content>
            </Col>
          </Row>
          <Row>
          </Row>
        </Container>

    );
};

export default Main;
